import React from "react";
import {BrowserRouter, Routes, Route} from 'react-router'
import Navbar from './Navbar'

class App extends React.Component {
    render() {
        return (
            <div>
                    <BrowserRouter>
                        <Navbar/>
                        <Routes>
                            <Route exact path="/" element =  {

                                    <div>
                                    </div>

                            }/>
                        </Routes> 
                    </BrowserRouter>
            </div>
        )
    }
}

export default App;
